import logo from './logo.svg';
import './App.css';
import HomePage from './HomePage';

function App() {
  return (
      <Router>
      <div className="App">
        <header className="App-header">
          <Route exact path="/" component={HomePage} />
        </header>
      </div>
    </Router>
  );
}

export default App;
